import React from "react";

import { Dimensions } from "react-native";
import { createStackNavigator } from "@react-navigation/stack";
import { createDrawerNavigator } from "@react-navigation/drawer";
import { Header } from "../components";
import { Camera } from "expo-camera";

import CustomDrawerContent from "./Menu";

import Onboarding from "../screens/Onboarding";

import Home from "../screens/Dashboard/Home";
import Suggest from "../screens/Category/Suggest";
import Expatriates from "../screens/Category/Expatriates";
import Medical from "../screens/Category/Medical";
import ServeOther from "../screens/Category/ServeOther";
import Event from "../screens/Category/Event";
import Parliament from "../screens/Category/Parliament";
import Mplad from "../screens/Category/Mplad";
import Loksabha from "../screens/Category/Loksabha";
import Public from "../screens/Category/Public";
import TicketDetails from "../screens/Dashboard/TicketDetails";

import Aboutus from "../screens/Sidemenu/Aboutus";
import Profile from "../screens/Sidemenu/Profile";
import Terms from "../screens/Sidemenu/Terms";
import Help from "../screens/Sidemenu/Help";
import Privacy from "../screens/Sidemenu/Privacy";

const { width } = Dimensions.get("screen");

const Stack = createStackNavigator();
const Drawer = createDrawerNavigator();

function HomeStack(props) {
  return (
    <Stack.Navigator mode="card" headerMode="screen">
      <Stack.Screen
        name="Home"
        component={Home}
        options={{
          header: ({ navigation, scene }) => (
            <Header
              title="Home | NeetiZen"
              navigation={navigation}
              scene={scene}
              bgColor="#4f3961"
              titleColor="white"
              iconColor="white"
            />
          ),
          cardStyle: { backgroundColor: "#F8F9FE" },
        }}
      />
      <Stack.Screen
        name="Suggest"
        component={Suggest}
        options={{
          header: ({ navigation, scene }) => (
            <Header
              title="Bring To Attention"
              back
              bgColor="#4f3961"
              titleColor="white"
              iconColor="white"
              navigation={navigation}
              scene={scene}
            />
          ),
          headerTransparent: false,
        }}
      />
      <Stack.Screen
        name="Expatriates"
        component={Expatriates}
        options={{
          header: ({ navigation, scene }) => (
            <Header
              title="Expatriates"
              back
              bgColor="#4f3961"
              titleColor="white"
              iconColor="white"
              navigation={navigation}
              scene={scene}
            />
          ),
          headerTransparent: false,
        }}
      />
      <Stack.Screen
        name="Camera"
        component={Camera}
        options={{
          header: ({ navigation, scene }) => (
            <Header
              title="Camera"
              back
              bgColor="#4f3961"
              titleColor="white"
              iconColor="white"
              navigation={navigation}
              scene={scene}
            />
          ),
          headerTransparent: false,
        }}
      />
      <Stack.Screen
        name="Medical"
        component={Medical}
        options={{
          header: ({ navigation, scene }) => (
            <Header
              title="Medical"
              back
              bgColor="#4f3961"
              titleColor="white"
              iconColor="white"
              navigation={navigation}
              scene={scene}
            />
          ),
          headerTransparent: false,
        }}
      />
      <Stack.Screen
        name="ServeOther"
        component={ServeOther}
        options={{
          header: ({ navigation, scene }) => (
            <Header
              title="Other"
              back
              bgColor="#4f3961"
              titleColor="white"
              iconColor="white"
              navigation={navigation}
              scene={scene}
            />
          ),
          headerTransparent: false,
        }}
      />
      <Stack.Screen
        name="Event"
        component={Event}
        options={{
          header: ({ navigation, scene }) => (
            <Header
              title="Invite"
              back
              bgColor="#4f3961"
              titleColor="white"
              iconColor="white"
              navigation={navigation}
              scene={scene}
            />
          ),
          headerTransparent: false,
        }}
      />
      <Stack.Screen
        name="Parliament"
        component={Parliament}
        options={{
          header: ({ navigation, scene }) => (
            <Header
              title="Raise In Parliament"
              back
              bgColor="#4f3961"
              titleColor="white"
              iconColor="white"
              navigation={navigation}
              scene={scene}
            />
          ),
          headerTransparent: false,
        }}
      />
      <Stack.Screen
        name="Mplad"
        component={Mplad}
        options={{
          header: ({ navigation, scene }) => (
            <Header
              title="MPLAD"
              back
              bgColor="#4f3961"
              titleColor="white"
              iconColor="white"
              navigation={navigation}
              scene={scene}
            />
          ),
          headerTransparent: false,
        }}
      />
      <Stack.Screen
        name="Loksabha"
        component={Loksabha}
        options={{
          header: ({ navigation, scene }) => (
            <Header
              title="Lok Sabha Speeches"
              back
              bgColor="#4f3961"
              titleColor="white"
              iconColor="white"
              navigation={navigation}
              scene={scene}
            />
          ),
          headerTransparent: false,
        }}
      />
      <Stack.Screen
        name="Public"
        component={Public}
        options={{
          header: ({ navigation, scene }) => (
            <Header
              title="Public Speeches"
              back
              bgColor="#4f3961"
              titleColor="white"
              iconColor="white"
              navigation={navigation}
              scene={scene}
            />
          ),
          headerTransparent: false,
        }}
      />
      <Stack.Screen
        name="TicketDetails"
        component={TicketDetails}
        options={{
          header: ({ navigation, scene }) => (
            <Header
              title="Ticket Details"
              back
              bgColor="#4f3961"
              titleColor="white"
              iconColor="white"
              navigation={navigation}
              scene={scene}
            />
          ),
          headerTransparent: false,
        }}
      />
    </Stack.Navigator>
  );
}

function AboutusStack(props) {
  return (
    <Stack.Navigator mode="card" headerMode="screen">
      <Stack.Screen
        name="About Us"
        component={Aboutus}
        options={{
          header: ({ navigation, scene }) => (
